import React from "react";

function App() {
  const offices = [
    { Name: "DBS", Rent: 50000, Address: "Chennai", Image: "https://t4.ftcdn.net/jpg/03/84/55/29/360_F_384552930_zPoe9zgmCF7qgt8fqSedcyJ6C6Ye3dFs.jpg" },
    { Name: "Regus", Rent: 70000, Address: "Bangalore", Image: "data:image/jpeg;base64," },
    { Name: "WeWork", Rent: 45000, Address: "Hyderabad", Image: "data:image/jpeg;base64," }
  ];

  return (
    <div style={{ textAlign: "center" }}>
      <h1>Office Space , at Affordable Range</h1>
      {offices.map((item, index) => {
        const color = item.Rent <= 60000 ? "textRed" : "textGreen";
        return (
          <div key={index} style={{ margin: "30px" }}>
            <img src={item.Image} width="25%" height="25%" alt="Office Space" />
            <h2>Name: {item.Name}</h2>
            <h3 className={color}>Rent: Rs. {item.Rent}</h3>
            <h3>Address: {item.Address}</h3>
          </div>
        );
      })}
    </div>
  );
}

export default App;